#!/usr/bin/env python3
"""
简单的测试脚本，用于验证content_identifier功能
"""

import asyncio
import sys
import os
sys.path.append(os.path.join(os.path.dirname(__file__), 'src'))

from content_identifier.content_identifier_function import ContentIdentifierFunctionConfig
from content_identifier.models.request import ContentIdentifyRequest
from nat.builder.workflow_builder import WorkflowBuilder

async def test_content_identifier():
    """测试content_identifier功能"""

    # 测试图片URL（公开可访问的示例图片）
    test_image_uri = "data:image/jpeg;base64,"

    print(f"Testing with image: {test_image_uri}")

    try:
        # 创建配置
        api_key = os.getenv("DASHSCOPE_API_KEY")
        if not api_key:
            raise ValueError("DASHSCOPE_API_KEY environment variable is required")

        function_config = ContentIdentifierFunctionConfig(
            api_key=api_key,
            base_url="https://dashscope.aliyuncs.com/compatible-mode/v1",
            model_name="qwen-vl-max-latest"
        )

        # 创建工作流构建器
        async with WorkflowBuilder() as builder:
            # 添加函数
            content_fn = await builder.add_function("content_identifier", function_config)

            # 创建请求
            request = ContentIdentifyRequest(image_uri=test_image_uri)

            # 调用函数
            print("Analyzing image...")
            response = await content_fn.ainvoke(request)

            print("\n=== 图像内容分析结果 ===")
            print(f"内容描述: {response.content}")
            print(f"亮度判断: {response.brightness}")

    except Exception as e:
        print(f"测试失败: {e}")
        import traceback
        traceback.print_exc()

if __name__ == "__main__":
    # 检查API密钥
    if not os.getenv("DASHSCOPE_API_KEY"):
        print("请设置DASHSCOPE_API_KEY环境变量")
        sys.exit(1)

    print("开始测试content_identifier功能...")
    asyncio.run(test_content_identifier())
